const HeaderComponent: React.FC = () => {
    return (
        <header>
            <h1 className="header_logo_font">PokeBank</h1>
            <div className="class">
            <span>National</span>
            <span>Regional</span>
            </div>
            <hr></hr>
        </header>
    )
}

export default HeaderComponent;
